import './App.css';
import React from 'react';
import { Button, Dropdown, Space, Menu } from 'antd';
import { PlusOutlined } from '@ant-design/icons';

const handleMenuClick = (e) => {
  console.log('click', e);
};

const menu = (
  <Menu
    onClick={handleMenuClick}
    items={[
      {
        label: '1st menu item',
        key: '1',
        icon: <PlusOutlined />,
      },
      {
        label: '2nd menu item',
        key: '2',
        icon: <PlusOutlined />,
      },
      {
        label: '3rd menu item',
        key: '3',
        icon: <PlusOutlined />,
      },
    ]}
  />
);

function App() {
  return (
    <div>
      <body className="App-header">
        <Dropdown overlay={menu}>
          <Button>
            <Space>
              Button
              <PlusOutlined />
            </Space>
          </Button>
        </Dropdown>
      </body>
    </div>
  );
}

export default App;
